function canvasInit(id) {
    console.log("Initializing Canvas");

    var docHeight = document.documentElement.clientHeight;
    var docWidth = document.documentElement.clientWidth;

    console.log("Maze Size", maze.x, maze.y);
    console.log("Client Size", docWidth, docHeight);

    var cellWallRatio = 4;

    var dx = docWidth / (maze.x + ((maze.x + 1)/ cellWallRatio));
    var dy = docHeight / (maze.y + ((maze.y + 1) / cellWallRatio));
    var d = Math.floor(Math.min(dx, dy));

    d = d - (d % cellWallRatio);

    var cellSize = Math.max(d, cellWallRatio);
    var wallSize = cellSize / cellWallRatio;

    console.log("Cell Size", cellSize);
    console.log("Wall Size", wallSize);

    var canvas = document.getElementById(id);
    var width = maze.x * cellSize + (maze.x + 1) * wallSize;
    var height = maze.y * cellSize + (maze.y + 1) * wallSize;

    canvas.width = width;
    canvas.height = width;

    console.log("Canvas Size", width, height);

    var ctx = canvas.getContext("2d");

    var links = {};
    for (var i = 0; i < maze.links.length; i++) {
        var link = maze.links[i];

        if (!links[link[0]]) {
            links[link[0]] = {};
        }

        links[link[0]][link[1]] = true;
    }

    console.log(links);

    ctx.strokeStyle = "black";
    ctx.lineWidth = wallSize;

    // Top
    ctx.moveTo(0, wallSize / 2);
    ctx.lineTo(width, wallSize / 2);

    // Left
    ctx.moveTo(wallSize / 2, 0);
    ctx.lineTo(wallSize / 2, height);

    for (var x = 0; x < maze.x; x++) {
        for (var y = 0; y < maze.y; y++) {
            var linkedRight = links[[x, y]] && links[[x, y]][[x + 1, y]] === true;
            var linkedBottom = links[[x, y]] && links[[x, y]][[x, y + 1]] === true;

            // console.log(x, y, linkedRight, linkedBottom);

            if (!linkedRight) {
                var startX = (wallSize * (x + 1)) + (cellSize * (x + 1)) + wallSize / 2;
                var startY = (wallSize * y) + (cellSize * y);

                ctx.moveTo(startX, startY);
                ctx.lineTo(startX, startY + cellSize + wallSize * 2);
                ctx.stroke();
            }

            if (!linkedBottom) {
                var startX = wallSize * x + cellSize * x;
                var startY = cellSize * (y + 1) + wallSize * (y + 1) + wallSize / 2;

                ctx.moveTo(startX, startY);
                ctx.lineTo(startX + cellSize + wallSize + (wallSize), startY);
                ctx.stroke();
            }
        }
    }
};
